import React, { Component } from "react";
import { connect } from "react-redux";
import { createFoodtruck } from "../../actions/foodtruckReducer";

class NewFoodtruck extends Component {
  state = {
    name: "",
    location: "",
    category: "",
    hours: "",
    score: 0,
    description: "",
  };

  handleChange = (e) => {
    this.setState({
      [e.target.name]: e.target.value,
    });
  };
  handleSubmit = (e) => {
    e.preventDefault();
    const accountId = this.props.account.id;
    console.log(this.state);
    // createFoodtruck(this.state, this.props.history, accountId);
  };
  render() {
    return (
      <div
        className="section"
        style={{
          display: "flex",
          flexDirection: "column",
          minHeight: "150vh",
        }}
      >
        <div className="center">
          <div className="container">
            <h5 className="indigo-text">
              Add a new FoodTruck to your profile!
            </h5>
            <div
              className="z-depth-1 grey lighten-4 container"
              style={{
                display: "inline-block",
                padding: "32px 48px 0px 48px",
                border: "1px solid #EEE",
              }}
            >
              <form onSubmit={this.handleSubmit}>
                <div className="row">
                  <div className="col s12">
                    <label htmlFor="name"></label>
                    <input
                      className="validate"
                      type="text"
                      name="name"
                      value={this.state.name}
                      onChange={this.handleChange}
                      placeholder="Enter the Foodtruck name"
                      required
                    ></input>
                  </div>
                </div>
                <div className="row">
                  <div className="col s12">
                    <label htmlFor="location"></label>
                    <input
                      className="validate"
                      type="text"
                      name="location"
                      value={this.state.location}
                      onChange={this.handleChange}
                      placeholder="Enter The Foodtruck location"
                      required
                    ></input>
                  </div>
                </div>
                <div className="row">
                  <div className="col s12">
                    <label htmlFor="category"></label>
                    <input
                      className="validate"
                      type="text"
                      name="category"
                      value={this.state.category}
                      onChange={this.handleChange}
                      placeholder="Enter The Foodtruck category"
                      required
                    ></input>
                  </div>
                </div>
                <div className="row">
                  <div className="col s12">
                    <label htmlFor="hours"></label>
                    <input
                      className="validate"
                      type="text"
                      name="hours"
                      value={this.state.hours}
                      onChange={this.handleChange}
                      placeholder="Enter The Foodtruck hours"
                      required
                    ></input>
                  </div>
                </div>
                <div className="row">
                  <div className="col s12">
                    <label htmlFor="description"></label>
                    <input
                      className="validate"
                      type="text"
                      name="description"
                      value={this.state.description}
                      onChange={this.handleChange}
                      placeholder="Enter The Foodtruck description"
                      required
                    ></input>
                  </div>
                </div>
                <div className="row col s12">
                  <label htmlFor="score"></label>
                  <p className="range-field row col s12">
                    <input
                      className="validate"
                      type="range"
                      step="1"
                      name="score"
                      min="0"
                      max="10"
                      value={this.state.score}
                      onChange={this.handleChange}
                      placeholder="Enter The Foodtruck score"
                      required
                    ></input>
                  </p>

                  <button type="submit" className="btn indigo col s12">
                    Submit
                  </button>
                </div>
              </form>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
const mapStateToProps = (state) => {
  return {
    foodtruckData: state.newReducer,
  };
};

export default connect(mapStateToProps, { updateLoginForm, login })(NewFoodtruck);
